import React from "react";
import "./App.css";
import axios from "axios";

function App() {
  async function test() {
    const res = await axios.post("http://localhost:3001", {
      username: "bob",
      password: "bob123",
    });
    console.log(res);
  }
  return <div className="App">hello</div>;
}

export default App;
